function App() {
    return(
        <div>
            <h2>Todo:</h2> 
            
            <div>
                <input type="checkbox"></input>
                <span>Buy milk</span>
            </div>
            <div>
                <input type="checkbox"></input>
                <span>Buy bread</span>
            </div>
            <div>
                <input type="checkbox"></input>
                <span>Buy cow</span>
            </div>
        </div>
    )
};

export default App;
